import { Card, Button } from "react-bootstrap";

const Home = () => {
    return (  
        <div>
            <Card style={{"margin":"20px 70px 20px 70px"}}>
                <Card.Img style={{"height":"400px","margin":"auto"}}  src="https://www.comundi.fr/mag-des-competences/wp-content/uploads/2019/11/Image-un-site-e-commerce-performant.png"></Card.Img>
                <Card.Body className="text-center">
                    <Card.Title>Discount Picker</Card.Title>
                    <Card.Text>Trouvez les meilleurs prix, promotions et ventes flash sur les sites e-commerce Tunisiens</Card.Text>
                    <Button variant="info" href="/promos">Consulter les promotions</Button>
                </Card.Body>
            </Card>
            <Card style={{"margin":"20px 70px 20px 70px"}}>
                <Card.Body className="text-center bg-danger">
                    <Card.Title>Second Card</Card.Title>
                </Card.Body>
            </Card>
        </div>
    );
}
 
export default Home;
